		_G.Details:ImportProfile(dtprofileRetail, "Eltreum Dual v3")
	elseif E.Classic then
		_G.Details:ImportProfile(dtprofileClassic, "Eltreum Dual v3")
	else
		_G.Details:ImportProfile(dtprofileCata, "Eltreum Dual v3")
	end

	if "Eltreum Dual v3" ~= _G.Details:GetCurrentProfileName() then
		_G.Details:ApplyProfile("Eltreum Dual v3")
	end
end
